During the late 1800s, the average American (adults as well as children as young as 5 yrs old)Â worked 12-hour days/ 7 days a week in order to make a living. Often times, working conditions were unsafe and provided limited access to fresh air, sanitary facilities and breaks. Labor unions (an organized association of workers created to protect their rights/interests) formed and began organizing strikes and rallies to protest poor working conditions. Many of these rallies turned violent and led to the deaths of policemen and workers alike. On Sep. 5th 1882, 10,000 workers took unpaid time off to march from City Hall to Union Square in NYC marking the first Labor Day parade in history. Soon, many states caught wind of this "workingmen's holiday" and passedÂ legislation'sÂ recognizing it. It wasn't untilÂ 12 years later, in 1894, that Congress finally made Labor Day an official holiday. Celebrated on the first Monday in September, Labor Day constitutes a yearly national tribute to the contributions workers have made to the strength, prosperity, and well-being of our country.Â 
Â 

We hope everyone has a safe and wonderful Labor Day weekend!Â 

